import React from "react";
import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  withStyles
} from "@material-ui/core";

const styles = theme => ({
  formControl: {
    margin: theme.spacing.unit,
    minWidth: 120
  }
});

export default withStyles(styles)(({ classes, values }) => {
  return (
    <FormControl className={classes.formControl}>
      <InputLabel>Type</InputLabel>
      <Select
        multiple
        value={values}
        // onChange={this.handleChange}
      >
        <MenuItem value="">
          <em>None</em>
        </MenuItem>
        {values.map(value => (
          <MenuItem value={value}>{value}</MenuItem>
        ))}
      </Select>
    </FormControl>
  );
});
